// Copyright Amazon.com, Inc. or its affiliates. All Rights Reserved.
// SPDX-License-Identifier: Apache-2.0
export function zipTwoArrays(a, b) {
    const longest = a.length >= b.length ? a : b;
    return longest.map((_, idx) => {
        return [a[idx], b[idx]];
    });
}
